import './styles.css';
import Card from '../Card';

const List = ({listTransactions }) => {


  return (
    <div>
      <span className='filters__container'>
        <p>Resumo Financeiro</p>
        <ul className='list__filters'>
          <li><button>Todos</button></li>
          <li><button>Entradas</button></li>
          <li><button>Despesas</button></li>
        </ul>

      </span>
      <ul className='list__transactions'>

        {listTransactions.map(({description, value, type}, index) => <Card description={description} type={type} value={value} key={index}/>)}

      </ul>
    </div>
  )
}

export default List;
